// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AquaGuard {
    struct Actuator {
        string actuatorType;
        bool state;
        uint32 lastUpdated;
    }

    struct Sensor {
        string sensorType;
        string value;
        uint32 lastUpdated;
    }

    struct Device {
        string serialNumber;
        address owner;
        bool isRegistered;
        string metadata; // Additional device information
        mapping(string => Actuator) actuators;
        mapping(string => Sensor) sensors;
    }

    struct Notification {
        string message;
        uint32 timestamp;
    }

    mapping(string => Device) private devices;
    mapping(string => Notification[]) private deviceNotifications; // Notifications per device
    mapping(address => bool) private admins;

    address public contractOwner;

    event DeviceRegistered(string serialNumber, address indexed owner, string metadata);
    event DeviceDeregistered(string serialNumber, address indexed owner);
    event SensorDataLogged(string serialNumber, string sensorType, string value, uint32 timestamp);
    event ActuatorStateUpdated(string serialNumber, string actuatorType, bool state, uint32 timestamp);
    event NotificationAdded(string serialNumber, string message, uint32 timestamp);
    event AdminAdded(address indexed admin);
    event AdminRemoved(address indexed admin);

    modifier onlyOwner(string memory serialNumber) {
        require(devices[serialNumber].owner == msg.sender, "Not authorized");
        _;
    }

    modifier onlyAdmin() {
        require(admins[msg.sender], "Not an admin");
        _;
    }

    constructor() {
        contractOwner = msg.sender;
        admins[msg.sender] = true; // Contract deployer is the first admin
    }

    // Admin Management
    function addAdmin(address admin) public {
        require(msg.sender == contractOwner, "Only contract owner can add admins");
        admins[admin] = true;
        emit AdminAdded(admin);
    }

    function removeAdmin(address admin) public {
        require(msg.sender == contractOwner, "Only contract owner can remove admins");
        admins[admin] = false;
        emit AdminRemoved(admin);
    }

    // Register Device
    function registerDevice(string memory serialNumber, string memory metadata) public {
        require(!devices[serialNumber].isRegistered, "Device already registered");

        devices[serialNumber].serialNumber = serialNumber;
        devices[serialNumber].owner = msg.sender;
        devices[serialNumber].isRegistered = true;
        devices[serialNumber].metadata = metadata;

        emit DeviceRegistered(serialNumber, msg.sender, metadata);
    }

    // Deregister Device
    function deregisterDevice(string memory serialNumber) public onlyOwner(serialNumber) {
        require(devices[serialNumber].isRegistered, "Device not registered");

        delete devices[serialNumber];
        delete deviceNotifications[serialNumber];

        emit DeviceDeregistered(serialNumber, msg.sender);
    }

    // Log Sensor Data
    function logSensorData(
        string memory serialNumber,
        string memory sensorType,
        string memory value
    ) public onlyOwner(serialNumber) {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Sensor storage sensor = devices[serialNumber].sensors[sensorType];
        sensor.sensorType = sensorType;
        sensor.value = value;
        sensor.lastUpdated = uint32(block.timestamp);

        emit SensorDataLogged(serialNumber, sensorType, value, uint32(block.timestamp));

        // Add a notification
        addNotification(serialNumber, string(abi.encodePacked("Sensor ", sensorType, " updated to ", value)));
    }

    // Update Actuator State
    function updateActuatorState(
        string memory serialNumber,
        string memory actuatorType,
        bool state
    ) public onlyOwner(serialNumber) {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Actuator storage actuator = devices[serialNumber].actuators[actuatorType];
        actuator.actuatorType = actuatorType;
        actuator.state = state;
        actuator.lastUpdated = uint32(block.timestamp);

        emit ActuatorStateUpdated(serialNumber, actuatorType, state, uint32(block.timestamp));

        // Add a notification
        addNotification(
            serialNumber,
            string(
                abi.encodePacked(
                    "Actuator ",
                    actuatorType,
                    " state updated to ",
                    state ? "ON" : "OFF"
                )
            )
        );
    }

    // Add a Notification
    function addNotification(string memory serialNumber, string memory message) internal {
        Notification memory notification = Notification({
            message: message,
            timestamp: uint32(block.timestamp)
        });

        deviceNotifications[serialNumber].push(notification);

        emit NotificationAdded(serialNumber, message, uint32(block.timestamp));
    }

    // Get Notifications for a Device
    function getNotifications(string memory serialNumber)
        public
        view
        returns (Notification[] memory)
    {
        require(devices[serialNumber].isRegistered, "Device not registered");
        return deviceNotifications[serialNumber];
    }

    // Get Sensor Data
    function getSensorData(string memory serialNumber, string memory sensorType)
        public
        view
        returns (string memory value, uint32 lastUpdated)
    {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Sensor storage sensor = devices[serialNumber].sensors[sensorType];
        return (sensor.value, sensor.lastUpdated);
    }

    // Get Actuator State
    function getActuatorState(string memory serialNumber, string memory actuatorType)
        public
        view
        returns (bool state, uint32 lastUpdated)
    {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Actuator storage actuator = devices[serialNumber].actuators[actuatorType];
        return (actuator.state, actuator.lastUpdated);
    }
}
